import styled from 'styled-components';
import { Slider } from './Slideshow';
import Product from './Products';

const Section = styled.section`
  display: flex;
  align-items: stretch;
`;

const MiniSec = styled.div`
  flex-grow: 6;
  `;




export const SectionProducts = () => {
  return (
    <Section>

      <MiniSec>
        <Slider/>
        <Product />
        <Product />
      </MiniSec>
      <MiniSec>

      </MiniSec>
    </Section>

  )
};
